import React from "react";

export default class Search extends React.Component {
    render() {
        return (
            <div className="row">
                <div className="col s12">
                    <div className="input-field inline">
                        <input id="email_inline" placeholder='search' type="search" className="validate" />
                    </div>
                </div>
            </div>
        )
    }
}
